import Navbar from 'react-bootstrap/Navbar';
import './nav.css'

function MyFooter() {
    return (
        <Navbar collapseOnSelect expand="lg" bg="light" variant="dark" className={"footerContainer"}>
                <h1 className={"footerText"}>@2022 Siya Choudhary</h1>
        </Navbar>
    );
}

export default MyFooter;
